import React from 'react'
import Head from 'next/head'

const LayoutAuth = ({ children, title = 'Login' }) => {
  return(
    <div>
      <Head>
        <meta charset="UTF-8" />
        <meta content="width=device-width, initial-scale=1, maximum-scale=1, shrink-to-fit=no" name="viewport" />
        <title>{title} &mdash; Stisla</title>
  
        {/* General CSS Files */}
        <link rel="stylesheet" href="/static/modules/bootstrap/css/bootstrap.min.css" />
        <link rel="stylesheet" href="/static/modules/fontawesome/css/all.min.css" />
  
        {/* CSS Libraries */}
        <link rel="stylesheet" href="/static/modules/bootstrap-social/bootstrap-social.css" />
  
        {/* Template CSS */}
        <link rel="stylesheet" href="/static/css/style.css" />
        <link rel="stylesheet" href="/static/css/components.css" />
  
        {/* Start GA */}
        <script async src="https://www.googletagmanager.com/gtag/js?id=UA-94034622-3" />
  
        {/* <script {{window.dataLayer = window.dataLayer || [];
            function gtag(){dataLayer.push(arguments);}
            gtag('js', new Date());
  
            gtag('config', 'UA-94034622-3');}}
        /> */}

<script dangerouslySetInnerHTML={{__html: `(function(w,d,s,l,i){w[l]=w[l]||[];w[l].push({'gtm.start':
        new Date().getTime(),event:'gtm.js'});var f=d.getElementsByTagName(s)[0],
        j=d.createElement(s),dl=l!='dataLayer'?'&l='+l:'';j.async=true;j.src=
        'https://www.googletagmanager.com/gtm.js?id='+i+dl;f.parentNode.insertBefore(j,f);
      })(window,document,'script','dataLayer','GTM-XXXXXX');`}} />
        {/* END GA */}
  
      </Head>

      {children}

    </div>
  )
}

export default LayoutAuth;
